import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

let initialStatePosts = [
    {
        message: 'Hi, how are you?',
        likesCount: '12'
    },
    {
        message: 'It\'s my first post',
        likesCount: '23'
    }
]

const MyPosts = (state=initialStatePosts, action) => {
    switch (action.action) {
        default:
            return state;
    }
}

let initialStateProfiles = [
    {
        userName: 'Andruha',
        birthDay: '12.08.1984',
        city: 'Minsck',
        aducation: 'higher',
        webSite: 'drunya35@gmail.com'
    },
    {
        userName: 'Dimich',
        birthDay: '02.01.1989',
        city: 'Minsck',
        aducation: 'higher',
        webSite: 'itcamasutra.com'
    }
]
const Profile = (state=initialStateProfiles, action) => {
    switch (action.action) {
        default:
            return state;
    }
}

ReactDOM.render(<App profile={props.Profile}/>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
